<span class="line"><span style="color:#FFCB6B;">root</span><span style="color:#EEFFFF;"> </span><span style="color:#C3E88D;">root</span><span style="color:#EEFFFF;"> </span><span style="color:#C3E88D;">tty1</span><span style="color:#EEFFFF;"> </span><span style="color:#F78C6C;">2</span><span style="color:#EEFFFF;"> </span><span style="color:#C3E88D;">Dec</span><span style="color:#EEFFFF;"> </span><span style="color:#F78C6C;">18</span><span style="color:#EEFFFF;"> </span><span style="color:#F78C6C;">13</span></span>
